function init() {
    map = new ol.Map({
        target: "this_map",
        layers: [
            new ol.layer.Tile({
                source: new ol.source.OSM()
            })
        ],
        view: new ol.View({
            center: [0, 0],
            zoom: 1
        })
    });
}

init();

function selectRoute(caseNumber, val) {
    var objReceived = cases[caseNumber][val];

    var path;
    var coordinates;
    var layerList = [];    

    for (var i = 0, j = objReceived.routeObj.length; i < j; i++) {
        path = objReceived.routeObj[i].geometry.paths;

        // Get the center route among all the route available
        if(i == Math.floor(j/2)) {
            // Get the center point
            pathSize = Math.floor(path.length/2)
            if(pathSize > 0) {
                pathSize -= 1;
            }

            innerPath = path[pathSize];
            mapCenter = innerPath[Math.floor(innerPath.length/2)-1];
        }
        layerList.push(getRouteLineVectorLayer(path,i));
    }

    map.setView(
        new ol.View({
            center: ol.proj.transform(mapCenter, 'EPSG:4326', 'EPSG:3857'),
            zoom: 12
        })
    );

    if(previousLayerList.length>0) {
        previousLayerList.forEach(function (v) {
            map.removeLayer(v);
        });
    }

    previousLayerList = layerList;

    layerList.forEach(function (v) {
        map.addLayer(v);
    })

    if(locationCoordinateList.length>0) {
        map.addLayer(getLocationLayer());
    }
}

function getLocationLayer() {
    console.log(locationCoordinateList);
    for (var k = 0, l = 49; k < l; k++) {
        // You need to transform depending on the type of map you are using. The below transformation is for bing & open street map
        locationCoordinateList[k] = ol.proj.transform(locationCoordinateList[k], 'EPSG:4326', 'EPSG:3857');
    }

    var locationFeature = new ol.Feature(new ol.geom.MultiPoint(locationCoordinateList));

    locationFeature.setStyle(
        new ol.style.Style({
            image: new ol.style.Circle({
                radius: 5,
                fill: new ol.style.Fill({
                    color: 'cyan'
                })
            })
        })
    );
    var locationPointVector = new ol.source.Vector({});
    locationPointVector.addFeature(locationFeature);

    var locationPointVectorLayer = new ol.layer.Vector({
        source: locationPointVector
    });
    console.dir(locationCoordinateList);
    return locationPointVectorLayer;
}

function getRouteLineVectorLayer(paths, colourNumber) {
    for (var k = 0, l = paths.length; k < l; k++) {
        // You need to transform depending on the type of map you are using. The below transformation is for bing & open street map
        var temp = paths[k];
        for (var m=0, n=temp.length; m<n ; m++) { //transformation process
            temp[m] = ol.proj.transform(temp[m], 'EPSG:4326', 'EPSG:3857');
        }
    }

    var routeFeature = new ol.Feature(new ol.geom.MultiLineString(paths));
    routeFeature.setStyle([
        new ol.style.Style({
            stroke: new ol.style.Stroke({
                    color: colours[colourNumber],
                    width: 2
                })
        })
    ]);
    var routeLineVector = new ol.source.Vector({});
    routeLineVector.addFeature(routeFeature);

    var routeLineVectorLayer = new ol.layer.Vector({
        source: routeLineVector
    });

    return routeLineVectorLayer;
}

function showRoute() {
    caseNumber = document.getElementById("caseNumber").value;
    val = document.getElementById("val").value;

    if ((caseNumber == undefined || caseNumber == null || caseNumber.length == 0) &&
        (val == undefined || val == null || val.length == 0)) {
        alert("Please ensure both text fields are filled in");
    } else if (caseNumber < 0 || caseNumber > 4) {
        alert("Case number can only be 2, 3 or 4");
    } else {
        if (caseNumber == 2 || caseNumber == 3) {
            if (val == 3 || val == 5 || val == 10) {
                selectRoute(caseNumber, val);
            } else {
                alert("Number of vehicles are only 3, 5 or 10");
            }
        } else if (caseNumber == 4) {
            if (val == 3 || val == 6) {
                selectRoute(caseNumber, val);
            } else {
                alert("Number of locations are only 3 or 6");
            }

        }
    }
}